import { Swiper, SwiperSlide } from "swiper/react";
import { swipperimage } from "../../../imagesdep";
// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";

import "./Swipper.css";

 // import required modules
  import { Pagination, Navigation } from "swiper";

  const ExploreImages=()=> {
    return (
      <>
        <Swiper
        breakpoints={
          {
            0:{
              slidesPerView:1,
              spaceBetween:10
            },
            480:{
              slidesPerView:1,
              spaceBetween:10
            },
            768:{
              slidesPerView:1,
              spaceBetween:15
            },
            1024:{
              slidesPerView:3,
              spaceBetween:15
            },
            1280:{
              slidesPerView:3,
              spaceBetween:25
            }
          }
        }
          slidesPerView={3}
          spaceBetween={30}
          slidesPerGroup={3}
          loop={true}
          loopFillGroupWithBlank={true}
          pagination={{
            clickable: true,
          }}
          navigation={true}
          modules={[Pagination, Navigation]}
          className="mySwiper"
        >
          <div className="swipper-container">
          <SwiperSlide className='swipper-item'>
            
          </SwiperSlide>
          </div>
        </Swiper>
      </>
    );
  }
  export default ExploreImages;
